import React from "react";
import { FaBuilding, FaStore, FaBriefcase, FaHome, FaHotel, FaCity, FaTree } from "react-icons/fa";

// Slider Component (SAME FILE ME RAKH SAKTE HO)
const CategorySlider = () => {
  const categories = [
    { name: "Kids House", icon: <FaHome />, count: 12 },
    { name: "Budget House", icon: <FaBuilding />, count: 18 },
    { name: "Luxury House", icon: <FaHotel />, count: 8 },
    { name: "Stylish House", icon: <FaCity />, count: 14 },
    { name: "Apartments", icon: <FaHome />, count: 22 },
    { name: "Farmhouse", icon: <FaTree />, count: 9 },
    { name: "Deluxe House", icon: <FaHome />, count: 7 },
    { name: "Nature House", icon: <FaTree />, count: 11 },
    { name: "2 BHK", icon: <FaHome />, count: 16 },
    { name: "3 BHK", icon: <FaHome />, count: 10 },
    { name: "Office Rooms", icon: <FaBriefcase />, count: 5 },
  ];

  const loopCategories = [...categories, ...categories];

  return (
    <div className="w-full overflow-hidden bg-[#07182E] py-10">
      <h2 className="text-white text-3xl font-bold text-center mb-6">
        Popular Categories
      </h2>

      <div className="relative w-full">
        <div className="flex gap-6 animate-slide">
          {loopCategories.map((item, index) => (
            <div
              key={index}
              className="min-w-[200px] bg-white/10 backdrop-blur-md border border-white/20 
              p-4 rounded-xl flex items-center gap-3 shadow-lg hover:scale-105 
              transition-all cursor-pointer text-white"
            >
              <div className="text-blue-300 text-2xl">{item.icon}</div>
              <div>
                <p className="font-semibold">{item.name}</p>
                <p className="text-sm opacity-80">{item.count} available</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      <style>{`
        .animate-slide {
          display: flex;
          width: max-content;
          animation: scroll 22s linear infinite;
        }

        @keyframes scroll {
          0% { transform: translateX(0); }
          100% { transform: translateX(-50%); }
        }
      `}</style>
    </div>
  );
};



// ========================= MAIN HOME PAGE =============================

const Home = () => {
  const categories = [
    { name: "Commercial Land", icon: <FaBuilding size={22} />, count: 12 },
    { name: "Showrooms & Shops", icon: <FaStore size={22} />, count: 18 },
    { name: "Office Rooms", icon: <FaBriefcase size={22} />, count: 9 },
    { name: "Residential", icon: <FaHome size={22} />, count: 25 },
  ];

  return (
    <div className="w-full">

      {/* Banner Section */}
      <div
        className="relative w-screen bg-cover bg-center"
        style={{
          backgroundImage:
            `url("https://images.unsplash.com/photo-1600585154340-be6161a56a0c?auto=format&fit=crop&w=1600&q=80")`,
          height: "68vh",
        }}
      >
        <div className="absolute inset-0 bg-black/50"></div>

        {/* Banner Content */}
        <div className="relative flex flex-col justify-center items-center h-full text-center px-4">
          <h1 className="text-white text-4xl sm:text-3xl font-bold drop-shadow-lg">
            Your Property, Our Priority
          </h1>

          <p className="text-white text-lg sm:text-xl mt-2 drop-shadow-lg">
            Buy • Sell • Rent • Luxury Estates • Apartments • Farmhouses
          </p>

          {/* Search Bar */}
          <div className="mt-5 bg-white/30 backdrop-blur-md border border-white/40 rounded-xl p-1 flex flex-col md:flex-row items-center gap-4 max-w-[800px] w-[90%]">

            <input
              type="text"
              placeholder="Find my property..."
              className="w-full md:w-[160px] bg-white p-2 text-sm rounded-md border outline-none"
            />

            <input
              type="text"
              placeholder="Search Location..."
              className="w-full md:w-[160px] bg-white p-2 text-sm rounded-md border outline-none"
            />

            <input
              type="date"
              className="w-full md:w-[130px] bg-white p-2 text-sm rounded-md border outline-none"
            />

            <input
              type="date"
              className="w-full md:w-[130px] bg-white p-2 text-sm rounded-md border outline-none"
            />

            <button className="bg-blue-600 hover:bg-blue-700 text-white px-5 py-2 rounded-lg text-sm font-semibold transition-all">
              Search
            </button>
          </div>
        </div>

        {/* Category Boxes Floating */}
        <div className="absolute bottom-[-50px] left-1/2 transform -translate-x-1/2 w-full px-6">
          <div className="max-w-[1000px] mx-auto grid grid-cols-2 sm:grid-cols-2 md:grid-cols-4 gap-5">
            {categories.map((item, index) => (
              <div
                key={index}
                className="bg-white/25 backdrop-blur-lg border border-white/40 
                p-4 rounded-xl text-gray-900
                shadow-xl hover:shadow-2xl hover:scale-[1.05] 
                transition-all duration-300 cursor-pointer
                flex flex-row items-center gap-3"
              >
                <div className="text-blue-600 text-xl">{item.icon}</div>

                <div>
                  <h3 className="font-semibold text-base">{item.name}</h3>
                  <p className="text-sm opacity-90">{item.count} Properties</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Spacing under boxes */}
      <div className="h-[70px]"></div>

      {/* ⭐ Category Slider Here */}
      <CategorySlider />
    </div>
  );
};

export default Home;
